text:
@luciopicci @marattin @istat_it Lasciamo da parte l’Istat. Quindi se il confronto è impossibile, come lei sostiene, @AndreaRoventini ha detto una stupidaggine? 
Perché la polemica di Marattin parte dai confronti fatti da Roventini.
Poi, per curiosità, come tenete “saldamente in mano” degli amici, i corsi?

Intendiamo discuterne con il #Governo e il resto della maggioranza: occorre intervenire quanto prima, per evitare che l'impennata dei costi di #luce e #gas impatti fortemente sui #consumatori italiani. 

@Mov5Stelle 

