Tutti gli Stati riconoscano le unioni fra persone dello stesso sesso effettuate all'interno dell'Ue. 

@Europarl_IT vota una risoluzione importante contro le discriminazioni in atto in alcuni paesi. 

Lega e FdI si oppongono: sono ostili per principio ai diritti delle persone.
